import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import {
    Collapse,
    Navbar,
    NavbarToggler,
    NavbarBrand,
    Nav,
    NavItem,
    NavLink,
    UncontrolledDropdown,
    DropdownToggle,
    DropdownMenu,
    DropdownItem,
    Button } from 'reactstrap';
import { db } from '../config.js';

let times = [];
db.ref('/Times').on('value', function(snapshot) {
    times = snapshot.val();
})

class ResultsPage extends Component {
    constructor(props) {
        super(props);
        this.state = {
            times: {
                first: "0",
                second: "1",
                third: "2",
                fourth: "3",
                fifth: "4",
                sixth: "5",
                seventh: "6",
                eighth: "7",
                ninth: "8"
            }
        }
      }
    render() {
        const mainBackground = {
            background: '#E8F4E7',
            height: '900px'
          };

        const mainContainer = {
            background: 'white',
            height: '900px'
        }

        const spacing = {
            height: '40px'
        }

        return (
            <div style={mainBackground}>
                <div style={mainContainer} class="container">
                    <div class="container-fluid text-center">
                            <h1 class="display-3 text-center border-bottom">Results</h1>
                    </div>
                    <div style={spacing}></div>
                    <div class="container-fluid">
                        <h1 class="font-weight-bold">Individual Peg Times</h1>
                        <DataPoint title="Time to place first peg: " value={times[0] + " second(s)"}/>
                        <DataPoint title="Time to place second peg: " value={times[1] + " second(s)"}/>
                        <DataPoint title="Time to place third peg: " value={times[2] + " second(s)"}/>
                        <DataPoint title="Time to place fourth peg: " value={times[3] + " second(s)"}/>
                        <DataPoint title="Time to place fifth peg: " value={times[4] + " second(s)"}/>
                        <DataPoint title="Time to place sixth peg: " value={times[5] + " second(s)"}/>
                        <DataPoint title="Time to place seventh peg: " value={times[6] + " second(s)"}/>
                        <DataPoint title="Time to place eighth peg: " value={times[7]+ " second(s)"}/>
                        <DataPoint title="Time to place ninth peg: " value={times[8] + " second(s)"}/>
                        <div style={spacing}></div>
                        <h1 class="font-weight-bold">Time Analysis</h1>
                        <DataPoint title="Average Peg placement time: " value={this.state.times.ninth + " second(s)"}/>
                        <DataPoint title="Deviation From Healthy Average: " value={"+3 second(s)"}/>
                        <DataPoint title="Degree of Impairment: " value={"Severe"}/>
                    </div>
                </div>
            </div>
        )
    }
}

class DataPoint extends Component {
    constructor(props) {
        super(props);
        this.state = {

        }
      }
    render() {
        const spacing = {
            height: '20px'
        }

        return (
            <div class="row">
                <div class="col">
                    <h3>{this.props.title + " "}</h3>
                </div>
                <div class="col">
                    <h5>{this.props.value}</h5>
                </div>
                <div style={spacing}></div>
            </div>
        )
    }
}

export default ResultsPage;
